CREATE DEFINER=`root`@`localhost` PROCEDURE `test1`()
BEGIN
	
  

  -- Declare '_val' variables to read in each record from the cursor
  DECLARE prof int;
  DECLARE esc int;
  DECLARE new_id int;
  DECLARE rand_id int default 0;
  -- Declare variables used just for cursor and loop control
  DECLARE no_more_rows BOOLEAN;
  DECLARE loop_cntr INT DEFAULT 0;
  DECLARE num_rows INT DEFAULT 0;

  -- Declare the cursor
  DECLARE friends_cur CURSOR FOR
    SELECT
       idprofesor,idescuela from profesor
       where idescuela in(select idescuela from asignaturaescuela);

  -- Declare 'handlers' for exceptions
  DECLARE CONTINUE HANDLER FOR NOT FOUND
    SET no_more_rows = TRUE;

  /*
    Now the programming logic
  */

  -- 'open' the cursor and capture the number of rows returned
  -- (the 'select' gets invoked when the cursor is 'opened')
  OPEN friends_cur;
  select FOUND_ROWS() into num_rows;

  the_loop: LOOP

    FETCH  friends_cur
    INTO   prof
    ,      esc;

    -- break out of the loop if
      -- 1) there were no records, or
      -- 2) we've processed them all
    IF no_more_rows THEN
        CLOSE friends_cur;
        LEAVE the_loop;
    END IF;

    -- the equivalent of a 'print statement' in a stored procedure
    -- it simply displays output for each loop
   
    select esc into new_id; -- 
    select new_id;
    
-- select idasignatura into rand_id from asignaturaescuela where idescuela=new_id order by rand() limit 1;
select idasignatura into rand_id from asignaturaescuela 
where idescuela=new_id  
and idasignatura not in (select idasignatura from profesorasignatura where idprofesor=prof)
order by rand() limit 1;

    -- select rand_id;
    insert into profesorasignatura values(prof,rand_id);
	--  select prof, esc,rand_id;
    -- count the number of times looped
    SET loop_cntr = loop_cntr + 1;

  END LOOP the_loop;

  -- 'print' the output so we can see they are the same
  select num_rows, loop_cntr;
END ;;
